export interface colourTemplate {
    background1: string;
    background2: string;
    font1: string;
    font2: string;
    font3: string;
}

export const colours: colourTemplate = {
    background1: "#ecf5f1", //"#e4ebeb"
    background2: "#FFFFFF",
    font1: "#08415C", //2c5194 //A4381D
    font2: "#F4978E", //967253 //EB6949
    font3: "#000000",
};
